import React from "react";
import PropTypes from "prop-types";
// react plugin for creating charts
import ChartistGraph from "react-chartist";
// @material-ui/core
import withStyles from "@material-ui/core/styles/withStyles";
import Icon from "@material-ui/core/Icon";
// @material-ui/icons
import Store from "@material-ui/icons/Store";
import Warning from "@material-ui/icons/Warning";
import DateRange from "@material-ui/icons/DateRange";
import LocalOffer from "@material-ui/icons/LocalOffer";
import Update from "@material-ui/icons/Update";
import ArrowUpward from "@material-ui/icons/ArrowUpward";
import AccessTime from "@material-ui/icons/AccessTime";
import Accessibility from "@material-ui/icons/Accessibility";
import BugReport from "@material-ui/icons/BugReport";
import Code from "@material-ui/icons/Code";
import Cloud from "@material-ui/icons/Cloud";
import Assignment from "@material-ui/icons/Assignment";
import Work from "@material-ui/icons/Work";
import Mood from "@material-ui/icons/Mood";
import Email from "@material-ui/icons/Email";
// other icons
// import { mdiSleep } from '@mdi/js';
// core components
import GridItem from "components/Grid/GridItem.jsx";
import GridContainer from "components/Grid/GridContainer.jsx";
import Table from "components/Table/Table.jsx";
import Tasks from "components/Tasks/Tasks.jsx";
import CustomTabs from "components/CustomTabs/CustomTabs.jsx";
import Danger from "components/Typography/Danger.jsx";
import Card from "components/Card/Card.jsx";
import CardHeader from "components/Card/CardHeader.jsx";
import CardIcon from "components/Card/CardIcon.jsx";
import CardBody from "components/Card/CardBody.jsx";
import CardFooter from "components/Card/CardFooter.jsx";
import { Link } from "react-router-dom";

import { bugs, website, server } from "variables/general.jsx";
import dashboardStyle from "assets/jss/material-dashboard-react/views/dashboardStyle.jsx";

class Halftime extends React.Component {
  state = {
    value: 0
  };
  handleChange = (event, value) => {
    this.setState({ value });
  };

  handleChangeIndex = index => {
    this.setState({ value: index });
  };

  render() {
    const { classes } = this.props;
    return (
      <div>
        <GridContainer>
          <GridItem xs={12} sm={12} md={4}>
            <Card chart>
              <CardHeader color="warning" />
              {/* <Warning >outlined style={{fontSize:100}/Warning> */}
              <CardBody>
                <h2 className={classes.cardTitle}>Least Engaged Students </h2>
                <Table
                  tableHeaderColor="primary"
                  tableHead= {["Name", "Average Engagement Value"]}
                  tableData={[
                    [<Link to="/students/JunJia">Er Jun Jia</Link>, "1"],
                    [<Link to="/students/GabrielSze">Gabriel Sze</Link>, "2"],
                    ["Tony Stones", "2"]
                  ]}
                />
                {/* <p className={classes.cardCategory}> */}
                {/* increase in engagement value over the week */}
                {/* </p> */}
              </CardBody>
            </Card>
          </GridItem>
          <GridItem xs={12} sm={12} md={4}>
            <Card chart>
              <CardHeader color="warning" />
              <CardBody>
                <h2 className={classes.cardTitle}>Recap these topics</h2>
                <Table
                  tableHeaderColor="primary"
                  tableHead={["Potentially Unclear Topics:"]}
                  tableData={[
                    ["Recursive Functions"],
                    ["Time Complexity"],
                    ["HTML Basic Syntax"]
                  ]}
                />
              {/* <CardFooter chart>
                <div className={classes.stats}>
                  <AccessTime /> campaign sent 2 days ago
                </div>
              </CardFooter> */}
              </CardBody>
            </Card>
          </GridItem>
          <GridItem xs={12} sm={12} md={4}>
            <Card chart>
              <CardHeader color="success" />
              <CardBody>
                <h1 className={classes.cardTitle}>Teaching Style</h1>
                <Table
                  tableHeaderColor="primary"
                  tableHead={["Can Try:"]}
                  tableData={[
                    ["More Group Work Assignments"],
                    ["More Discussions"]
                  ]}
                />
              </CardBody>
              {/* <CardFooter chart>
                <div className={classes.stats}>
                  <AccessTime /> campaign sent 2 days ago
                </div>
              </CardFooter> */}
            </Card>
          </GridItem>
        </GridContainer>
        <GridContainer />
      </div>
    );
  }
}

export default withStyles(dashboardStyle)(Halftime);
